function countingValleys(n, hike) {

  var numValleys = 0;

  var enteredValley = false;

  var numStepsDown = 0;
  var numStepsUp = 0;

  Array.from(hike).forEach((step, stepIdx) => {

    if (hike[stepIdx] === 'U') {
      numStepsUp++;
    } else if (hike[stepIdx] === 'D') {
      numStepsDown++
    }

    if (numStepsDown > numStepsUp) {
      enteredValley = true;
      isSeaLevel = false;
    } else if (numStepsUp === numStepsDown && enteredValley) {
      numValleys++;
      enteredValley = false;
      isSeaLevel = true;
    } else if (numStepsDown < numStepsUp) {
      enteredValley = false;
      isSeaLevel = false;
    }
  })

  return numValleys;

}

